        int width = tab_view_tab_width(priv, page);
        if (width <= 0)
        {
            continue;
        }
        if (tab_x >= origin_x + tab_view->width)
        {
            break;
        }
        if (tab_x + width > origin_x + tab_view->width)
        {
            width = origin_x + tab_view->width - tab_x;
